import React, { useEffect, useState } from 'react';
import {
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  Typography,
  Box,
  CircularProgress,
  Chip,
  TextField,
  Button,
  InputAdornment,
  useTheme,
} from '@mui/material';
import { Search, LocalHospital, School, Security, SupportAgent } from '@mui/icons-material';
import axios from 'axios';

interface CommunityResource {
  id: number;
  title: string;
  description: string;
  category: string;
  contact_info: {
    phone?: string;
    email?: string;
  };
  url?: string;
  is_active: boolean;
}

const CommunityDashboard: React.FC = () => {
  const [resources, setResources] = useState<CommunityResource[]>([]);
  const [loading, setLoading] = useState(true);
  const [searchQuery, setSearchQuery] = useState('');
  const [filterOptions, setFilterOptions] = useState({ category: '' });
  const theme = useTheme();

  useEffect(() => {
    const fetchResources = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`${process.env.COMMUNITY_API_URL}/community-resources/`, {
          params: { ...filterOptions, search: searchQuery },
        });
        setResources(response.data);
      } catch (error) {
        console.error('Error fetching resources:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchResources();
  }, [searchQuery, filterOptions]);

  const getCategoryIcon = (category: string) => {
    switch (category.toLowerCase()) {
      case 'emergency':
        return <LocalHospital color="error" />;
      case 'education':
        return <School color="primary" />;
      case 'support':
        return <SupportAgent color="info" />;
      default:
        return <Security color="action" />;
    }
  };

  const handleSearchChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSearchQuery(event.target.value);
  };

  const handleFilterChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setFilterOptions((prevState) => ({
      ...prevState,
      [event.target.name]: event.target.value,
    }));
  };

  const handleSearchSubmit = () => {
    // Add any specific search submit functionality if needed
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box sx={{ px: 3, py: 5 }}>
      <Typography variant="h4" gutterBottom sx={{ fontWeight: 'bold', mb: 3 }}>
        Community Resources
      </Typography>

      {/* Search and Filter Section */}
      <Box sx={{ display: 'flex', gap: 2, alignItems: 'center', mb: 3 }}>
        <TextField
          label="Search"
          value={searchQuery}
          onChange={handleSearchChange}
          variant="outlined"
          fullWidth
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <Button
                  variant="contained"
                  onClick={handleSearchSubmit}
                  sx={{
                    backgroundColor: theme.palette.primary.main,
                    '&:hover': {
                      backgroundColor: theme.palette.primary.dark,
                    },
                  }}
                  startIcon={<Search />}
                >
                  Search
                </Button>
              </InputAdornment>
            ),
          }}
        />
        <TextField
          label="Category Filter"
          name="category"
          value={filterOptions.category}
          onChange={handleFilterChange}
          variant="outlined"
        />
      </Box>

      {/* Resource List Section */}
      <List>
        {resources.map((resource) => (
          <ListItem
            key={resource.id}
            sx={{
              mb: 2,
              p: 2,
              backgroundColor: theme.palette.background.default,
              borderRadius: 1,
              boxShadow: '0 2px 6px rgba(0, 0, 0, 0.1)',
              '&:hover': {
                backgroundColor: theme.palette.action.hover,
              },
            }}
          >
            <ListItemIcon>{getCategoryIcon(resource.category)}</ListItemIcon>
            <ListItemText
              primary={
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Typography variant="h6" sx={{ fontWeight: 600 }}>
                    {resource.title}
                  </Typography>
                  <Chip
                    label={resource.category}
                    size="small"
                    sx={{
                      backgroundColor: `${theme.palette.primary.main}15`,
                      color: theme.palette.primary.main,
                    }}
                  />
                </Box>
              }
              secondary={
                <>
                  <Typography variant="body2" sx={{ mt: 1 }}>
                    {resource.description}
                  </Typography>
                  <Box sx={{ mt: 1 }}>
                    {resource.contact_info.phone && (
                      <Typography variant="body2">
                        <strong>Phone:</strong> {resource.contact_info.phone}
                      </Typography>
                    )}
                    {resource.contact_info.email && (
                      <Typography variant="body2">
                        <strong>Email:</strong> {resource.contact_info.email}
                      </Typography>
                    )}
                    {resource.url && (
                      <Typography variant="body2">
                        <strong>More Info:</strong>{' '}
                        <a href={resource.url} target="_blank" rel="noopener noreferrer">
                          Visit
                        </a>
                      </Typography>
                    )}
                  </Box>
                </>
              }
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );
};

export default CommunityDashboard;
